/***												***/
/***	作成日	: H8.3.2							***/
/***	作成者	: JUN								***/
/***												***/
/***	ﾌﾟﾛﾄﾀｲﾌﾟ: void	change_chi_angle(			***/
/***						struct chi_dat			***/
/***							*chi_dat_p			***/
/***					);							***/
/***	引数	: 乳ﾃﾞ-ﾀﾎﾟｲﾝﾀ						***/
/***	戻り値	: Nothing							***/
/***												***/
/******************************************************/

void	change_chi_angle(
			struct chi_dat *chi_dat_p
		)
{

	long	*move_ang_p;			/* 現在の移動角ﾃﾞ-ﾀﾎﾟｲﾝﾀ				*/


	move_ang_p	= &chi_dat_p->move_angle;
	if (chi_dat_p->del_point == 0) {
		*move_ang_p  = chi_dat_p->vec_angle;	/* 止まっている時は親の移動	*/
		*move_ang_p &= 0xC000;					/* がそのまま反映			*/
	}
	else {
		*move_ang_p += 0x8000;					/* 移動方向は+180度		*/
		*move_ang_p &= 0xC000;					/* 						*/
	}

}/* change_chi_angle */


