/***	作成日	: H8.3.1							***/
/***	作成者	: JUN								***/
/***												***/
/***	ﾌﾟﾛﾄﾀｲﾌﾟ: INT	get_gen_point(					***/
/***						struct chi_dat			***/
/***							*chi_dat_p			***/
/***					);							***/
/***	引数	: 乳ﾃﾞ-ﾀﾎﾟｲﾝﾀ						***/
/***	戻り値	: ﾎﾟｲﾝﾀの変化量						***/
/***												***/
/******************************************************/

INT		get_gen_point(
			struct chi_dat *chi_dat_p
		)
{

	INT		obj_point;				/* 乳ｵﾌﾞｼﾞｪｸﾄﾎﾟｲﾝﾄﾅﾝﾊﾞ-					*/
	INT		rvalue;					/* 返り値								*/


	obj_point = chi_dat_p->obj_point;			/* 							*/
	if		(obj_point < 0)						/* 							*/
		obj_point = 0;							/* 							*/
	else if	(obj_point > MAX_POINT)				/* 							*/
		obj_point = MAX_POINT;					/* 							*/
	obj_point >>= 4;							/* 							*/

	rvalue										/* 現在の乳ﾎﾟｲﾝﾀ				*/
		= *(chi_dat_p->gensoku_p + obj_point);	/* 移動角より復元力を求める		*/

	return(rvalue);

}/* get_gen_point */


/******************************************************/
/***												***/
/***	機能	: 復元力によるﾎﾟｲﾝﾀの変化量算出		***/
/***												***/
/***	作成日	: H8.3.1							***/
/***	作成者	: JUN								***/
/***												***/
/***	ﾌﾟﾛﾄﾀｲﾌﾟ: int	get_recon_point(			***/
/***						struct chi_dat			***/
/***							*chi_dat_p			***/
/***					);							***/
/***	引数	: 乳ﾃﾞ-ﾀﾎﾟｲﾝﾀ						***/
/***	戻り値	: ﾎﾟｲﾝﾀの変化量						***/
/***												***/
/******************************************************/

INT		get_recon_point(
			struct chi_dat *chi_dat_p
		)
{

	INT		obj_point;				/* ｵﾌﾞｼﾞｪｸﾄﾎﾟｲﾝﾄﾅﾝﾊﾞ-						*/
	INT		rvalue;					/* 返り値								*/
	long	index;					/* ﾃﾞ-ﾀ検索用ｲﾝﾃﾞｯｸｽ						*/
	long	angle;					/* 作業用角度変数						*/


//	angle = chi_dat_p->move_angle & 0xE000;		/* 移動方向を8方向ｲﾝﾃﾞｯｸｽ化	*/
//	angle >>= 13;								/* 							*/
//	if		(angle < 0)		angle = 0;			/* 							*/
//	else if	(angle > 7)		angle = 7;			/* 							*/
	angle	= chi_dat_p->move_angle & 0x8000;	/* 移動方向を2方向ｲﾝﾃﾞｯｸｽ化	*/
	angle	= chi_dat_p->move_angle >> 15;		/* 							*/

	obj_point = chi_dat_p->obj_point;			/* 							*/
	if		(obj_point < 0)						/* 							*/
		obj_point = 0;							/* 							*/
	else if	(obj_point > MAX_POINT)				/* 							*/
		obj_point = MAX_POINT;					/* 							*/
	obj_point >>= 4;							/* 							*/

	index = angle << 4;							/* 現在の乳ﾎﾟｲﾝﾀ、移動角		*/
	index += obj_point;							/* をｲﾝﾃﾞｯｸｽとして				*/
	rvalue = *(chi_dat_p->recon_p + index);		/* 復元力を求める				*/

	return(rvalue);

}/* get_recon_point */


