/***												***/
/******************************************************/

void	init_chi_dat(
			INT ply_no,
			INT chr_no
		)
{

	INT		i, ii;					/* ﾙ-ﾌﾟ用変数							*/
	INT		tmp_int;

	void	**chi_tbl_ptr;			/* ﾀｲﾐﾝｸﾞﾃﾞ-ﾀ内乳ﾃﾞ-ﾀﾃ-ﾌﾞﾙﾎﾟｲﾝﾀ			*/
	INT		*dat_ptr;				/* ﾀｲﾐﾝｸﾞﾃﾞ-ﾀ内乳ﾃﾞ-ﾀﾎﾟｲﾝﾀ				*/
	INT		*ang_total_p;			/* 角度累計格納ｱﾄﾞﾚｽﾎﾟｲﾝﾀ					*/

	struct chi_dat	*chi_dat_p;		/* 乳ﾃﾞ-ﾀﾎﾟｲﾝﾀ							*/


#if TEST_FLG

	if (chr_no != NAME_KASUMI) {
		return;
	}

	chi_dat_p = (chi_dat + ply_no);				/* ﾃﾞ-ﾀﾎﾟｲﾝﾀｾｯﾄ				*/

	chi_dat_p->char_no		= chr_no;			/* ｷｬﾗｸﾀ-ﾅﾝﾊﾞ-				*/

	chi_dat_p->stop_flg		= OFF;				/* 外部からの強制停止ﾌﾗｸﾞ		*/

	chi_dat_p->in_vec_x		= 0.0;				/* ﾜ-ﾙﾄﾞ系の入力Xﾍﾞｸﾄﾙ		*/
	chi_dat_p->in_vec_y		= 0.0;				/* ﾜ-ﾙﾄﾞ系の入力Yﾍﾞｸﾄﾙ		*/
	chi_dat_p->in_vec_z		= 0.0;				/* ﾜ-ﾙﾄﾞ系の入力Zﾍﾞｸﾄﾙ		*/

	chi_dat_p->in_angle_x	= 0.0;				/* 胸のX軸回転角度			*/
	chi_dat_p->in_angle_y	= 0.0;				/* 胸のY軸回転方向			*/

	chi_dat_p->vec_angle	= 0;				/* 入力ﾍﾞｸﾄﾙの角度			*/
	chi_dat_p->vec_length	= 0;				/* 入力ﾍﾞｸﾄﾙの長さ			*/

	chi_dat_p->move_angle	= 0;				/* 移動方向					*/

	chi_dat_p->del_point	= 0;				/* ﾎﾟｲﾝﾄ変化量				*/
	chi_dat_p->del_point_bk	= 0;				/* 　　〃　　　のﾊﾞｯｸｱｯﾌﾟ		*/
	chi_dat_p->obj_point	= 0;				/* ｵﾌﾞｼﾞｪｸﾄﾎﾟｲﾝﾄ				*/
	chi_dat_p->obj_no		= CENTER_OBJ_NO;	/* ｵﾌﾞｼﾞｪｸﾄﾅﾝﾊﾞ-				*/


	/************************************************************/
	/* 乳の個体ﾃﾞ-ﾀの初期化 BINﾃﾞ-ﾀは、ﾀｲﾐﾝｸﾞﾃﾞ-ﾀの直下にある	*/
	/************************************************************/
	chi_tbl_ptr	= (void**)chi_dat_ks;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_DAT_INDEX);
	chi_dat_p->gensoku		= (INT)*(dat_ptr    );
	tmp_int					= (INT)*(dat_ptr + 1);
	chi_dat_p->hard			= (FIXED)(tmp_int << 16);

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_REC_INDEX);
	chi_dat_p->recon_p		= dat_ptr;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_GRAVI_INDEX);
	chi_dat_p->gravi_p		= dat_ptr;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_GENSOKU_INDEX);
	chi_dat_p->gensoku_p	= dat_ptr;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_PNT_CNT_INDEX);
	chi_pnt_cnt_p			= (INT*)dat_ptr;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_PNT_NO_INDEX);
	chi_pnt_no_p			= (Uint8**)dat_ptr;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_PNT_DIS_INDEX);
	chi_pnt_dis_p			= (POINT**)dat_ptr;
#endif

	for (i = 0; i < MAX_BASE; i++) {
		chi_spd[ply_no][i]	=  toFIXED(0.005);
		chi_point[ply_no][i][X]	= toFIXED(0.0);
		chi_point[ply_no][i][Y]	= toFIXED(0.0);
		chi_point[ply_no][i][Z]	= toFIXED(0.0);
	}

}/*** init_chi_dat() ***/


