/***	ﾌﾟﾛﾄﾀｲﾌﾟ: INT	get_del_point_move(				***/
/***						struct chi_dat			***/
/***							*chi_dat_p			***/
/***					);							***/
/***	引数	: 乳ﾃﾞ-ﾀﾎﾟｲﾝﾀ						***/
/***	戻り値	: ﾎﾟｲﾝﾀの変化量						***/
/***												***/
/******************************************************/

INT		get_del_point_move(
			struct chi_dat *chi_dat_p
		)
{

	long	index;					/* ﾃﾞ-ﾀ検索用ｲﾝﾃﾞｯｸｽ						*/
	FIXED	vec_cos;				/* 入力ﾍﾞｸﾄﾙのｺｻｲﾝ値						*/
	FIXED	rvalue;					/* 返り値								*/


	/* 現在の移動角とﾍﾞｸﾄﾙの方向の差分を求める（８方向化）	*/
	index	= chi_dat_p->move_angle				/* 現在の移動角とﾍﾞｸﾄﾙの		*/
			- chi_dat_p->vec_angle;				/* 方向の差分を求める			*/
	index	&= 0xE000;							/* (8方向化)					*/

	if (index) {								/* 現在の移動角とﾍﾞｸﾄﾙが		*/
		rvalue	= -chi_dat_p->vec_length;		/* 同方向の時				*/
	}											/* 							*/
	else {										/* 現在の移動角とﾍﾞｸﾄﾙが		*/
		rvalue	=  chi_dat_p->vec_length;		/* 逆方向の時				*/
	}											/* 							*/

	return((INT)rvalue);

}/* get_del_point_move */


/******************************************************/
/***												***/
/***	機能	: 乳ﾍﾞ-ｽ及び、乳頂点の座標算出			***/
/***												***/
/***	作成日	: H8.12.05							***/
/***	作成者	: JUN								***/
/***												***/
/***	ﾌﾟﾛﾄﾀｲﾌﾟ: void	chi_pos_calc(				***/
/***						INT		base_no			***/
/***					)							***/
/***	引数	: 乳ﾍﾞ-ｽﾅﾝﾊﾞ-						***/
/***	戻り値	: Nothing							***/
/***												***/
/******************************************************/

void	chi_pos_calc(
			struct chi_dat	*chi_dat_p,
			Uint8			ply_no,
			INT				base_no
		)
{

	INT		i;						/* ﾙ-ﾌﾟ用変数							*/
	INT		point_cnt;
	Uint8	l_point_no;				/* 作業頂点ﾅﾝﾊﾞ-							*/
	Uint8	l_pos_index;			/* 作業頂点座標ﾃﾞ-ﾀｲﾝﾃﾞｯｸｽ				*/
	FIXED	l_chi_pnt_dis;
	void	*l_ptr;
	POINT	*l_chi_point_plane;
	POINT	*l_pnt_dis_p;
	Uint8	*l_pnt_no_p;


	l_chi_point_plane	= point_chest[ply_no];
	l_pnt_no_p			= chi_dat_p->pnt_no_p[base_no];
	l_pnt_dis_p			= chi_dat_p->pnt_dis_p[base_no];
	for (i = 0; i < chi_dat_p->pnt_cnt[base_no]; i++) {
		l_point_no	= (Uint8)*l_pnt_no_p;
//		l_chi_point_plane[l_point_no][X]		/* ﾎﾟﾘｺﾞﾝ頂点のX座標を更新		*/
//			= chi_point_ks_dis[base_no][i][X]	/* 							*/
//			+ chi_point[ply_no][base_no][X];	/* 							*/
		l_chi_point_plane[l_point_no][Y]		/* ﾎﾟﾘｺﾞﾝ頂点のY座標を更新		*/
			= l_pnt_dis_p[i][Y]
			+ chi_point[ply_no][base_no][Y];	/* 							*/
		l_pnt_no_p++;
	}

}/*	chi_pos_calc()	*/


/******************************************************/
/***												***/
/***	機能	: 乳ﾃﾞ-ﾀの初期化(Ver.2)				***/
/***												***/
/***	作成日	: H8.3.1							***/
/***	作成者	: JUN								***/
/***												***/
/***	ﾌﾟﾛﾄﾀｲﾌﾟ: void	init_chi_dat(				***/
/***						INT	ply_no,				***/
/***						INT	chr_no				***/
/***					)							***/
/***	引数	: ﾌﾟﾚｲﾔ-ﾅﾝﾊﾞ-						***/
/***			  ｷｬﾗｸﾀ-ﾅﾝﾊﾞ-						***/
/***	戻り値	: Nothing							***/
/***												***/
/******************************************************/

void	init_chi_dat(
			INT ply_no,
			INT chr_no
		)
{

	INT		i, ii;					/* ﾙ-ﾌﾟ用変数							*/
	INT		l_int;

	void	**chi_tbl_ptr;			/* ﾀｲﾐﾝｸﾞﾃﾞ-ﾀ内乳ﾃﾞ-ﾀﾃ-ﾌﾞﾙﾎﾟｲﾝﾀ			*/
	INT		*dat_ptr;				/* ﾀｲﾐﾝｸﾞﾃﾞ-ﾀ内乳ﾃﾞ-ﾀﾎﾟｲﾝﾀ				*/
	INT		*ang_total_p;			/* 角度累計格納ｱﾄﾞﾚｽﾎﾟｲﾝﾀ					*/

	struct chi_dat	*chi_dat_p;		/* 乳ﾃﾞ-ﾀﾎﾟｲﾝﾀ							*/


	if (chr_no != NAME_KASUMI) {
		return;
	}

	chi_dat_p = (chi_dat + ply_no);				/* ﾃﾞ-ﾀﾎﾟｲﾝﾀｾｯﾄ				*/

	chi_dat_p->char_no		= chr_no;			/* ｷｬﾗｸﾀ-ﾅﾝﾊﾞ-				*/

	chi_dat_p->stop_flg		= OFF;				/* 外部からの強制停止ﾌﾗｸﾞ		*/

	chi_dat_p->in_vec_x		= 0.0;				/* ﾜ-ﾙﾄﾞ系の入力Xﾍﾞｸﾄﾙ		*/
	chi_dat_p->in_vec_y		= 0.0;				/* ﾜ-ﾙﾄﾞ系の入力Yﾍﾞｸﾄﾙ		*/
	chi_dat_p->in_vec_z		= 0.0;				/* ﾜ-ﾙﾄﾞ系の入力Zﾍﾞｸﾄﾙ		*/

	chi_dat_p->in_angle_x	= 0.0;				/* 胸のX軸回転角度			*/
	chi_dat_p->in_angle_y	= 0.0;				/* 胸のY軸回転方向			*/

	chi_dat_p->vec_angle	= 0;				/* 入力ﾍﾞｸﾄﾙの角度			*/
	chi_dat_p->vec_length	= 0;				/* 入力ﾍﾞｸﾄﾙの長さ			*/

	chi_dat_p->move_angle	= 0x4000;			/* 移動方向					*/

	chi_dat_p->del_point	= 0;				/* ﾎﾟｲﾝﾄ変化量				*/
	chi_dat_p->del_point_bk	= 0;				/* 　　〃　　　のﾊﾞｯｸｱｯﾌﾟ		*/
	chi_dat_p->obj_point	= 0;				/* ｵﾌﾞｼﾞｪｸﾄﾎﾟｲﾝﾄ				*/
	chi_dat_p->obj_no		= CENTER_OBJ_NO;	/* ｵﾌﾞｼﾞｪｸﾄﾅﾝﾊﾞ-				*/


	/************************************************************/
	/* 乳の個体ﾃﾞ-ﾀの初期化 BINﾃﾞ-ﾀは、ﾀｲﾐﾝｸﾞﾃﾞ-ﾀの直下にある	*/
	/************************************************************/
	chi_tbl_ptr	= (void**)chi_dat_ks;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_DAT_INDEX);
	chi_dat_p->gensoku		= (INT)*(dat_ptr    );
	l_int					= (INT)*(dat_ptr + 1);
	chi_dat_p->hard			= (FIXED)l_int;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_REC_INDEX);
	chi_dat_p->recon_p		= dat_ptr;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_GRAVI_INDEX);
	chi_dat_p->gravi_p		= dat_ptr;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_GENSOKU_INDEX);
	chi_dat_p->gensoku_p	= dat_ptr;

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_PNT_CNT_INDEX);
	chi_dat_p->pnt_cnt[0]	= (INT)*(dat_ptr    );
	chi_dat_p->pnt_cnt[1]	= (INT)*(dat_ptr + 1);

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_PNT_NO_INDEX);
	chi_dat_p->pnt_no_p[0]	= (Uint8*)(dat_ptr);
	chi_dat_p->pnt_no_p[1]	= (Uint8*)((Uint32)dat_ptr
							+ (Uint32)chi_dat_p->pnt_cnt[0]);

	dat_ptr	= (INT*)*(chi_tbl_ptr + CHI_PNT_DIS_INDEX);
	chi_dat_p->pnt_dis_p[0]	= (POINT*)(dat_ptr);
	chi_dat_p->pnt_dis_p[1]	= (POINT*)((Uint32)dat_ptr
							+ (Uint32)(chi_dat_p->pnt_cnt[0]*12));

	for (i = 0; i < MAX_BASE; i++) {
		chi_point[ply_no][i][X]	= toFIXED(0.0);
		chi_point[ply_no][i][Y]	= toFIXED(0.0);
		chi_point[ply_no][i][Z]	= toFIXED(0.0);
	}

}/*** init_chi_dat() ***/


